import React, { useState } from 'react';
import YouTube from 'react-youtube';

export const Tools = () => {
  const [videoId, setVideoId] = useState('VIDEO_ID');

  const handleVideoChange = (event) => {
    const newVideoId = event.target.value;
    setVideoId(newVideoId);
  };

  const opts = {
    height: '360',
    width: '640',
    playerVars: {
      autoplay: 1,
    },
  };

  return (
    <div>
      <h2>YouTube Video Player</h2>
      <label htmlFor="videoId">Enter YouTube Video ID:</label>
      <input id="videoId" type="text" onChange={handleVideoChange} value={videoId} />
      <br />
      <YouTube videoId={videoId} opts={opts} />
    </div>
  );
};



